import Card from "@mui/material/Card";
import Grid from "@mui/material/Grid";
import SuiBox from "components/SuiBox";
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import DataTable from "examples/Tables/DataTable";
import SuiTypography from "components/SuiTypography";
import ProductCell from "layouts/ecommerce/products/product-page/components/ProductCell";
import ReviewCell from "layouts/ecommerce/products/product-page/components/ReviewCell";
import DefaultCell from "layouts/ecommerce/products/product-page/components/DefaultCell";
import SuiProgress from "components/SuiProgress";
// Images
const blackChair =
  "https://raw.githubusercontent.com/creativetimofficial/public-assets/master/soft-ui-design-system/assets/img/ecommerce/black-chair.jpg";


function Opportunity() {
    const columns =
    {
        columns: [
            // { Header: "Investor Name", accessor: "InvestorName" },
            // { Header: "BSE UCC", accessor: "Location" },
            // { Header: "PAN No", accessor: "Investments" },

            { Header: "product", accessor: "product", width: "50%" },
            { Header: "price", accessor: "price", width: "10%" },
            { Header: "review", accessor: "review", align: "center" },
            { Header: "availability", accessor: "availability", align: "center", width: "40%" },
            { Header: "id", accessor: "id", align: "center" },
        ],

        rows: [
            // {
            //     InvestorName: "Vipin Raj M",
            //     Location: "V56",
            //     Investments: "	AKSPM1698L",
            // },

            // {
            //     InvestorName: "Tapan Kumar Barik",
            //     Location: "T61",
            //     Investments: "AZDPB1453C",
            // },

            {
                product: <ProductCell image={blackChair} name="Christopher Knight Home" />,
                price: <DefaultCell>$89.53</DefaultCell>,
                review: <ReviewCell rating={4.5} />,
                availability: (
                    <SuiBox width="8rem">
                        <SuiProgress value={80} color="success" gradient noLabel />
                    </SuiBox>
                ),
                id: <DefaultCell>230019</DefaultCell>,
            },
        ],

    }

    return (
        <DashboardLayout>
            <DashboardNavbar />
            <SuiBox my={3}>

                <SuiBox mb={3}>
                    <Grid container spacing={3} alignItems="center">
                        <Grid item xs={12} lg={12}>

                            <SuiBox
                                backgroundColor="dark"
                                borderRadius="lg"
                                boxShadow="lg"
                                p={2}
                                backgroundGradient
                                lineHeight={1}
                            >
                                <SuiTypography variant="h6" fontWeight="medium" textColor="white">
                                    SIP Opportunity Report (339)
                                </SuiTypography>
                                <br />
                                <SuiBox mb={3}>
                                    <SuiTypography variant="button" fontWeight="regular" textColor="white">
                                        This report shows the clients who have BSE ids but do not have any running SIP.<br />
                                        For generating a list of clients who do not have mandates or BSE ids, please apply the filter in the User page
                                    </SuiTypography>
                                </SuiBox>

                            </SuiBox>
                        </Grid>
                    </Grid>
                </SuiBox>
            </SuiBox>

            <SuiBox>
                <Card id="change-password">
                    <SuiBox >
                        <DataTable table={columns} />
                    </SuiBox>

                </Card>
            </SuiBox>
            <Footer />
        </DashboardLayout>
    );
}

export default Opportunity;
